import '../css/Home.css';
import {
    Button,
    Form,
    FormGroup,
    Input,
    Label
} from 'reactstrap';
import SignIn from "./SignIn";
import SignUp from "./SignUp";

class Home extends React.Component {

    constructor() {
        super();
        this.state={
            email:'',
            password:'',
            login:false
        }
    }


    render() {

        let home=<SignUp/>
        if(this.state.login){
            home=<SignIn/>
        }


        return (
            <div>
                {home}
            </div>

            );
        }
    }

    export default Home
